describe("MapController",function(){var b,c;var a=document.body;beforeEach(function(){module("ngMap");inject(function(e,d){b=d;c=e("MapController",{$scope:b,NavigatorGeolocation:{},GeoCoder:{}})})});describe("addObject",function(){it("should add a marker to the existing map",function(){c.map=new google.maps.Map(a,{});c.map.markers={};var d=new google.maps.Marker({position:new google.maps.LatLng(1,1),centered:true});c.addObject("markers",d);expect(d.getMap()).toBe(c.map);expect(d.getPosition()).toBe(c.map.getCenter());expect(Object.keys(c.map.markers).length).toEqual(1)});it("should add a marker to ctrl._objects when ctrl.map is not init",function(){c._objects=[];var d=new google.maps.Marker({position:new google.maps.LatLng(1,1)});c.addObject("markers",d);expect(c._objects[0]).toBe(d)})});describe("addShape",function(){it("should add a shape to ctrl._objects when ctrl.map is not init",function(){c._objects=[];var d=new google.maps.Circle({center:new google.maps.LatLng(1,1)});c.addObject("shapes",d);expect(c._objects[0]).toBe(d)});it("should add a shape to the existing map",function(){c.map=new google.maps.Map(a,{});c.map.shapes={};var d=new google.maps.Circle({center:new google.maps.LatLng(1,1)});c.addObject("shapes",d);expect(c.map.shapes[0]).toBe(d);expect(c.map.shapes[0].getMap()).toBe(c.map)})});describe("addObjects",function(){it("should add objects; markers and shapes when map is init",function(){var d=new google.maps.Marker({position:new google.maps.LatLng(1,1)});var f=new google.maps.Circle({center:new google.maps.LatLng(1,1)});var e=[d,f];c.map=new google.maps.Map(a,{});c.addObjects(e);expect(d.getMap()).toBe(c.map);expect(f.getMap()).toBe(c.map)})})});